import React from 'react';

// Тестовые данные
export const testProperty = {
  name: "Квартира мечты",
  description: "Просторная квартира с видом на город, свежий ремонт.",
  cntrooms: 3,
  square: 85,
  floor: 5,
  images: [
    "https://images.cdn-cian.ru/images/2653186249-1.jpg",
    "https://images.cdn-cian.ru/images/2653186278-1.jpg"
  ],
  url: "https://example.com/property/1",
  price: 15000000,
  priceForMetr: 176470,
  address: "г. Москва, ул. Примерная, д. 10",
  station: "м. Парк Культуры",
  map: {
    "Продукты": [
      { name: "Пятёрочка", address: "ул. Ленина, 5", coords: [37.618423, 55.751244] },
      { name: "Перекрёсток", address: "ул. Ленина, 10", coords: [37.620000, 55.752000] }
    ],
    "Школы": [
      { name: "Школа №12", address: "ул. Ленина, 12", coords: [37.619000, 55.753000] }
    ],
    "Детские сады": [],
    "Медицина": [
      { name: "Поликлиника №5", address: "ул. Ленина, 20", coords: [37.621000, 55.754000] }
    ],
    "Аптеки": [],
    "Спорт": [],
    "Культура": [],
    "Бары": [
      { name: "Бар Пятница", address: "ул. Ленина, 15", coords: [37.622000, 55.755000] }
    ]
  }
};

// Компонент для отображения недвижимости
const PropertyCard = ({ property, onClick }) => {
  return (
    <div className="property-card" style={{ border: "1px solid #ccc", padding: "20px", marginBottom: "20px" }}>
      <h2>{property.name}</h2>
      <p>{property.description}</p>
      <p><strong>Комнат:</strong> {property.cntrooms}</p>
      <p><strong>Площадь:</strong> {property.square} м²</p>
      <p><strong>Этаж:</strong> {property.floor}</p>
      <p><strong>Адрес:</strong> {property.address}</p>
      <p><strong>Ближайшая станция метро:</strong> {property.station}</p>
      <p><strong>Цена:</strong> {property.price.toLocaleString()} ₽</p>
      <p><strong>Цена за м²:</strong> {property.priceForMetr.toLocaleString()} ₽/м²</p>

      <div className="images" style={{ display: "flex", gap: "10px", overflowX: "auto" }}>
        {property.images.map((img, idx) => (
          <img key={idx} src={img} alt={`Фото ${idx + 1}`} style={{ width: "200px", height: "150px", objectFit: "cover", borderRadius: "8px" }} />
        ))}
      </div>

      <h3>Инфраструктура поблизости:</h3>
      {Object.keys(property.map).map((category) => (
        <div key={category} style={{ marginBottom: "10px" }}>
          <strong>{category}:</strong>
          {property.map[category].length === 0 ? (
            <span> Нет данных</span>
          ) : (
            <ul>
              {property.map[category].map((place, idx) => (
                <li key={idx}>
                  {place.name} — {place.address} ({place.coords[0].toFixed(5)}, {place.coords[1].toFixed(5)})
                </li>
              ))}
            </ul>
          )}
        </div>
      ))}

      <p>
        <a href={property.url} target="_blank" rel="noopener noreferrer">Смотреть на сайте</a>
      </p>
    </div>
  );
};

export default PropertyCard;
